                                     <div class=""col-sm-12 col-md-10 col-lg-10 text-left accordion-content-details"">
                                        <p>&nbsp;</p>
                                        <p>I wasn't raised eating only plants. Like most kids, I was raised on the standard western diet of meat and dairy products, highly processed and artificially sweetened foods, with minimal contribution of fruits, vegetables, pulses and whole grains. From the first tastes of meat, chocolate and cheese, our minds are set, our beliefs are concrete - we are now brainwashed and addicted. </p>

                                        <p>Sometime in my mid-teens, when I began ");
            WriteLiteral(@"studying all things health and fitness related, I realised the importance of nutrition in my physical training, so I began eating a 'healthy' omnivorous diet, one of 'lean' white meat, tuna fish, skimmed cow's milk and egg whites, with plenty of fruit and vegetables, of course. I felt very healthy.</p>

                                        <p>Looking back, I wasn't <strong>truly</strong> healthy, I was just young.</p>
                                        <p>&nbsp;</p>
