                        <div class=""accordion-content-wrapper"">
                            <div class=""row align-items-center justify-content-center presentation-container"">
                                <div class=""col-sm-12 col-md-10 col-lg-10 text-left"">
                                <p>&nbsp;</p>
                                <p>My journey to plant-based began by reading Dan Buettner's 2008 book, The Blue Zones, which catalogues his exploration of the longest living peoples on our planet. A true inspiration – I read this book in springtime, accompanied with bread, olives and a glass of <em>Cannonau di Sardegna</em>.</p>
                                <p>Introduced to the concept of plant-based, Dan's book was followed by studying the work of Ancel Keys and his Seven Countries Study (the original study of the Mediterranean diet), T.C. Cam");
            WriteLiteral(@"pbell and his China Study, as well as the Willcox's study of the Okinawan centenarians. The pattern was obvious; those living the longest and healthiest lives followed a whole-food, plant-based diet.</p>
