                                <div class=""col-sm-12 col-md-10 col-lg-10 text-left"">
                                <p>&nbsp;</p>
                                <p>Once I discovered that the healthiest diet for humans was whole food plant-based, that we don’t need meat for growth and muscle strength, and that animal-based food is actually detrimental to long-term health, I never ate meat again. An overnight decision - this was actually the easiest change I made.</p>
                                <p>Dairy and eggs were more of an issue. These nasty foods are everywhere – dairy milk in chocolate, cheese on pizzas, eggs in all things baked – I couldn’t escape them! Furthermore, trying my best to avoid them - I just didn’t realise how dependent on these foods I was. I had more learning to do – and some lifelong food addictions to extinguish.</p>
                                <p>&nbsp;</p>
