                                <p>&nbsp;</p");
            WriteLiteral(@">
                                <p>Transitioning from vegetarian to exclusively plant-based was the most challenging yet educational and inspiring two years of my journey. Learning to bake without eggs, realising dark chocolate is superior to milk chocolate, and that cheese and butter is simply not for human consumption. I replaced and ultimately removed these foods from my diet and my mind completely.</p>
                                <p>Over the last several years, I have been fully immersed in the plant-based lifestyle. Travelling the world to learn recipes and mindsets, a real journey of discovery. How do you eat plant-based in the meat-eating city of Cali, Colombia? How do you enjoy?</p>
