                                <p>&nbsp;</p>
                                <p>After a day visiting towns in the mountains of Antioquia, Colombia, I returned to my apartment in Medellin, inspired and ready to work - I opened my laptop and started typing. There’s something about voluntary solitude and writing. This habit repeated itself ");
            WriteLiteral(@"in further trips, Blue Mountains in Jamaica, Nicoya Peninsula in Costa Rica and Cameron Highlands in Malaysia to name a few.</p>
                                <p>Over the last several years, I have spent countless hours answering the questions and queries of my nearest and dearest, and being told over and over – write your book! So I started flirting with my ideas in 2016, crystallising my concepts, and putting pen to paper. The seeds of the Blueprint.</p>
